import React, { Component } from 'react';
export default class Header extends Component {
    render() {
        return (
            <React.Fragment>
                <div id="about">
                    <div class="row">
                        <div className="three-columns">
                            <img className="profile-pic" alt="Tim Baker Profile Pic" src="images/profilepic.jpg"></img>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}
